import { useEffect, useState } from 'react';
import './App.css';
import AddButton from './AddButton';
import ResetButton from './ResetButton';

function App() {
  const [count, setCount] = useState(0);

  useEffect(() => {
    if(count < 0) setCount(0);
  })

  return (
    <div className="App">
      <AddButton count={ count } />
      <ResetButton count={ count } />
      <h1>Count: { count }</h1>
    </div>
  );
}

export default App;
